import React from "react";
import graph from "./graphs.png";

const Analysis = () => {
  return (
    <>
      <h2 className="text-center m-5 text-2xl ">&lt; Analysis &gt;</h2>
      <img src={graph} alt="Analysis graphs" />
    </>
  );
};

export default Analysis;
